import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import api from '../api/axios';
import { useAuth } from '../context/AuthContext';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';

const Dashboard = () => {
  const [history, setHistory] = useState([]);
  const { user, logout } = useAuth();
  const navigate = useNavigate();

  const exams = ["ESIC", "RRB", "NORCET", "NHM", "CHO", "UPPSC", "KGMU", "SGPGI", "MNS"];

  useEffect(() => {
    const fetchHistory = async () => {
      try {
        const { data } = await api.get('/quiz/history');
        setHistory(data);
      } catch (err) {
        console.error(err);
      }
    };
    fetchHistory();
  }, []);

  const chartData = history.slice().reverse().map(attempt => ({
    date: new Date(attempt.date).toLocaleDateString(),
    score: (attempt.score / attempt.totalQuestions) * 100
  }));

  return (
    <div className="p-8 max-w-6xl mx-auto">
      <div className="flex justify-between items-center mb-8">
        <h1 className="text-3xl font-bold text-gray-800">Welcome, {user.name}</h1>
        <button onClick={logout} className="bg-red-500 text-white px-4 py-2 rounded">Logout</button>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-3 gap-6 mb-8">
        <div className="bg-white p-6 rounded shadow">
          <h3 className="text-lg font-semibold mb-2">Total Quizzes</h3>
          <p className="text-4xl font-bold text-blue-600">{history.length}</p>
        </div>
        <div className="bg-white p-6 rounded shadow">
          <h3 className="text-lg font-semibold mb-2">Avg Score</h3>
          <p className="text-4xl font-bold text-green-600">
            {history.length > 0 
              ? (history.reduce((acc, curr) => acc + (curr.score / curr.totalQuestions), 0) / history.length * 100).toFixed(1)
              : 0}%
          </p>
        </div>
        <div className="bg-white p-6 rounded shadow">
          <h3 className="text-lg font-semibold mb-2">Latest Score</h3>
          <p className="text-4xl font-bold text-purple-600">
            {history.length > 0 ? ((history[0].score / history[0].totalQuestions) * 100).toFixed(1) : 0}%
          </p>
        </div>
      </div>

      <div className="bg-white p-6 rounded shadow mb-8">
        <h3 className="text-xl font-bold mb-4">Performance Trend</h3>
        <div className="h-64">
          <ResponsiveContainer width="100%" height="100%">
            <LineChart data={chartData}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="date" />
              <YAxis domain={[0, 100]} />
              <Tooltip />
              <Line type="monotone" dataKey="score" stroke="#4f46e5" strokeWidth={2} />
            </LineChart>
          </ResponsiveContainer>
        </div>
      </div>

      <h2 className="text-2xl font-bold mb-4">Select Exam to Practice</h2>
      <div className="grid grid-cols-2 md:grid-cols-3 lg:grid-cols-5 gap-4 mb-8">
        {exams.map(exam => (
          <button
            key={exam}
            onClick={() => navigate(`/quiz/${exam}`)}
            className="bg-white p-4 rounded shadow hover:bg-blue-50 transition border border-transparent hover:border-blue-400 font-semibold text-gray-700"
          >
            {exam}
          </button>
        ))}
      </div>

      <h2 className="text-2xl font-bold mb-4">Attempt History</h2>
      <div className="bg-white rounded shadow overflow-hidden">
        <table className="w-full text-left">
          <thead className="bg-gray-50">
            <tr>
              <th className="p-4">Date</th>
              <th className="p-4">Exam</th>
              <th className="p-4">Score</th>
              <th className="p-4">Correct</th>
            </tr>
          </thead>
          <tbody>
            {history.map((attempt, i) => (
              <tr key={i} className="border-t">
                <td className="p-4">{new Date(attempt.date).toLocaleDateString()}</td>
                <td className="p-4 font-semibold">{attempt.exam}</td>
                <td className="p-4">{(attempt.score / attempt.totalQuestions * 100).toFixed(1)}%</td>
                <td className="p-4">{attempt.score} / {attempt.totalQuestions}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Dashboard;
